import logo from './logo.svg';
import './App.css';
import "../src./components/dynamic-styles.css"

function DynamicSheets (){
  return <div className = ".dynamic-sheets">
    <h1>Title</h1>
    <p>Content</p>
    <p>Total</p>
  </div>
}


function App() {
  return (
    <div >
      <DynamicSheets/>
    </div>
  );
}

export default App;
